import React from "react";

function ProjectsSection() {
  return (
    <section id="projects" className="section projects">
      <h2>Projects</h2>
      <div className="project">
        <h3>Customer Churn Prediction</h3>
        <p>
          Machine learning model for churn prediction using Scikit-Learn and
          SMOTE.{" "}
        </p>
      </div>
      <div className="project">
        <h3>Weather Forecast App</h3>
        <p>
          React-based app delivering real-time weather updates.{" "}
          <a href="https://github.com/CharviBasappa/WeatherApp">GitHub</a>
        </p>
      </div>
      <div className="project">
        <h3>Online Movie Application</h3>
        <p>
          Online movie booking app with secure payments via PayPal.{" "}
          <a href="https://github.com/CharviBasappa/WebApplication_Movie">
            GitHub
          </a>
        </p>
      </div>
    </section>
  );
}

export default ProjectsSection;
